import './App.css';
import Hdr from './components/Hdr.js';
import AddItemPage from './AddItemPage.js';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  const setIsLoggedIn = function() {
    // 
  };

  return (
    <Router>
      <div>
        <Routes>
          <Route exact path='/' element={<Hdr loginHandler={setIsLoggedIn} />} />
          <Route path='/loggedin' element={<Hdr loginHandler={setIsLoggedIn} />} />
          <Route path='/add' element={<Hdr loginHandler={setIsLoggedIn} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
